import React from "react";
import styled from "styled-components";
import { useHistory } from "react-router-dom";
import { NavLink as Link } from "react-router-dom";
import Home from "../pages/Home";
function Navbar() {

  const history = useHistory();
  const HomeClick = () => history.push("./");
  const BuyClick = () => history.push("./Buy");
  const SellClick = () => history.push("./Sell");
  const ManagedClick = () => history.push("./Managed");
  const AboutAutohub = () => history.push("./AboutAutohub");
  const CCenterClick = () => history.push("./CCenter");
  const JoinClick = () => history.push("./Join");
  const LoginClick = () => history.push("./Login");




  return (
    <Body>
    <Header>
    <AutohubLogoPart>
<AutohubLogo src="/images/AUTOHUB Logo.png" />

      <div>

  <HeaderLeftListPart>
<HeaderLeftList><ALinkList>살때</ALinkList></HeaderLeftList>
<HeaderLeftList><ALinkList>팔때</ALinkList></HeaderLeftList>
<HeaderLeftList><ALinkList>직영차</ALinkList></HeaderLeftList>
<HeaderLeftList><ALinkList>단지안내</ALinkList></HeaderLeftList>
<HeaderLeftList><ALinkList>고객센터</ALinkList></HeaderLeftList>

<HeaderRightList><ALinkList>로그인</ALinkList></HeaderRightList>
<HeaderRightList><ALinkList>회원가입</ALinkList></HeaderRightList>
  </HeaderLeftListPart>
      </div>





    </AutohubLogoPart>




    </Header>

      </Body>
  );
}

const Body = styled.body`
box-sizing: border-box;
margin: 0;
padding: 0;
`;


const Header = styled.header`
height: 80px;
background-color:#f11843 ;
color: #fff;

`;
const AutohubLogoPart = styled.div`
display: flex;


`;
const AutohubLogo = styled.img`

width: 8rem;
height: 3rem;
padding-top: 10px;
margin-left: 50px;
cursor: pointer;
`;

const HeaderLeftListPart = styled.ul`
display: flex;
list-style: none;

`;
const ALinkList = styled.a`
display: block;
  color: white;
  text-align: center;
  padding: 14px 16px;
  text-decoration: none;
`;
const HeaderLeftList = styled.li`

float: left;

border-bottom: 3px solid transparent;
&:hover {
    border-bottom: 3px solid white;
  }
`;

const HeaderRightList = styled.li`

text-decoration: none;
float: right;

color: #fff;
border-bottom: 3px solid transparent;
&:hover {
    border-bottom: 3px solid white;
  }
`;


export default Navbar;
